import React, { useState } from 'react';
import { 
  Users, 
  CheckCircle, 
  Clock, 
  Archive,
  Plus,
  Filter,
  Search,
  UserPlus,
  TrendingUp,
  AlertCircle
} from 'lucide-react';
import { mockLeads, mockTasks } from '../mockData';
import TasksWidget from './TasksWidget';

const OwnerLeadsDashboard = ({ onNavigateToList, onNavigateToLead }) => {
  const [searchTerm, setSearchTerm] = useState('');

  // Calculate stats
  const stats = {
    total: mockLeads.filter(l => l.status !== 'archived').length,
    partial: mockLeads.filter(l => l.status === 'partial').length,
    qualified: mockLeads.filter(l => l.status === 'qualified').length,
    approved: mockLeads.filter(l => l.status === 'approved').length,
    onboarding: mockLeads.filter(l => l.onboardingStatus === 'in_progress').length
  };

  // Get recent leads by stage
  const getLeadsByStage = (status) => {
    return mockLeads
      .filter(l => l.status === status)
      .slice(0, 5);
  };

  const partialLeads = getLeadsByStage('partial');
  const qualifiedLeads = getLeadsByStage('qualified');
  const approvedLeads = getLeadsByStage('approved');

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    const now = new Date();
    const diffMs = now - date;
    const diffDays = Math.floor(diffMs / (1000 * 60 * 60 * 24));

    if (diffDays === 0) return 'Today';
    if (diffDays === 1) return 'Yesterday';
    if (diffDays < 7) return `${diffDays} days ago`;
    return date.toLocaleDateString();
  };

  const StatsCard = ({ title, value, icon: Icon, color, trend, onClick }) => (
    <div 
      className="stats-card" 
      style={{ borderLeftColor: color }}
      onClick={onClick}
      style={{ cursor: onClick ? 'pointer' : 'default' }}
    >
      <div className="stats-card-header">
        <div className="stats-card-icon" style={{ backgroundColor: `${color}20`, color }}>
          <Icon size={24} />
        </div>
        <div className="stats-card-info">
          <div className="stats-card-title">{title}</div>
          <div className="stats-card-value">{value}</div>
        </div>
      </div>
      {trend && (
        <div className="stats-card-trend" style={{ color }}>
          <TrendingUp size={14} />
          <span>{trend}</span>
        </div>
      )}
    </div>
  );

  const LeadCard = ({ lead, onClick }) => (
    <div className="lead-card" onClick={() => onClick(lead.id)}>
      <div className="lead-card-header">
        <div className="lead-card-avatar">
          {lead.firstName[0]}{lead.lastName[0]}
        </div>
        <div className="lead-card-info">
          <div className="lead-card-name">{lead.firstName} {lead.lastName}</div>
          <div className="lead-card-contact">{lead.email}</div>
        </div>
      </div>
      <div className="lead-card-details">
        {lead.completionPercentage < 100 && (
          <div className="lead-card-progress">
            <div className="progress-bar">
              <div 
                className="progress-fill" 
                style={{ width: `${lead.completionPercentage}%` }}
              />
            </div>
            <span className="progress-text">{lead.completionPercentage}% complete</span>
          </div>
        )}
        <div className="lead-card-meta">
          <span className="meta-item">
            <Clock size={14} />
            {formatDate(lead.createdAt)}
          </span>
          {lead.assignedTo && (
            <span className="meta-item">
              <Users size={14} />
              {lead.assignedTo}
            </span>
          )}
          {lead.properties.length > 0 && (
            <span className="meta-item">
              {lead.properties.length} {lead.properties.length === 1 ? 'property' : 'properties'}
            </span>
          )}
        </div>
      </div>
    </div>
  );

  return (
    <div className="owner-leads-dashboard">
      {/* Header */}
      <div className="dashboard-header">
        <div>
          <h1 className="dashboard-title">Owner Leads</h1>
          <p className="dashboard-subtitle">Manage and track your owner lead pipeline</p>
        </div>
        <div className="dashboard-actions">
          <button className="btn btn-secondary">
            <Filter size={18} />
            Filter
          </button>
          <button className="btn btn-primary" onClick={() => onNavigateToList()}>
            <UserPlus size={18} />
            New Lead
          </button>
        </div>
      </div>

      {/* Stats Cards */}
      <div className="stats-grid">
        <StatsCard
          title="Total Active Leads"
          value={stats.total}
          icon={Users}
          color="#3b82f6"
          trend="+12% this month"
        />
        <StatsCard
          title="Partial Leads"
          value={stats.partial}
          icon={AlertCircle}
          color="#f59e0b"
        />
        <StatsCard
          title="Qualified Leads"
          value={stats.qualified}
          icon={CheckCircle}
          color="#10b981"
        />
        <StatsCard
          title="In Onboarding"
          value={stats.onboarding}
          icon={Clock}
          color="#8b5cf6"
        />
      </div>

      <div className="dashboard-content">
        {/* Left Column - Lead Stages */}
        <div className="dashboard-main">
          {/* Partial Leads */}
          <div className="leads-section">
            <div className="section-header">
              <h2 className="section-title">
                <AlertCircle size={20} style={{ color: '#f59e0b' }} />
                Partial Leads ({partialLeads.length})
              </h2>
              <button 
                className="btn-link"
                onClick={() => onNavigateToList('partial')}
              >
                View All
              </button>
            </div>
            <div className="leads-list">
              {partialLeads.length > 0 ? (
                partialLeads.map(lead => (
                  <LeadCard key={lead.id} lead={lead} onClick={onNavigateToLead} />
                ))
              ) : (
                <div className="empty-state">No partial leads</div>
              )}
            </div>
          </div>

          {/* Qualified Leads */}
          <div className="leads-section">
            <div className="section-header">
              <h2 className="section-title">
                <CheckCircle size={20} style={{ color: '#10b981' }} />
                Qualified Leads ({qualifiedLeads.length})
              </h2>
              <button 
                className="btn-link"
                onClick={() => onNavigateToList('qualified')}
              >
                View All
              </button>
            </div>
            <div className="leads-list">
              {qualifiedLeads.length > 0 ? (
                qualifiedLeads.map(lead => (
                  <LeadCard key={lead.id} lead={lead} onClick={onNavigateToLead} />
                ))
              ) : (
                <div className="empty-state">No qualified leads</div>
              )}
            </div>
          </div>

          {/* Approved Leads / Onboarding */}
          <div className="leads-section">
            <div className="section-header">
              <h2 className="section-title">
                <Clock size={20} style={{ color: '#8b5cf6' }} />
                In Onboarding ({approvedLeads.length})
              </h2>
              <button 
                className="btn-link"
                onClick={() => onNavigateToList('approved')}
              >
                View All
              </button>
            </div>
            <div className="leads-list">
              {approvedLeads.length > 0 ? (
                approvedLeads.map(lead => (
                  <LeadCard key={lead.id} lead={lead} onClick={onNavigateToLead} />
                ))
              ) : (
                <div className="empty-state">No leads in onboarding</div>
              )}
            </div>
          </div>
        </div>

        {/* Right Column - Tasks Widget */}
        <div className="dashboard-sidebar">
          <TasksWidget onNavigateToLead={onNavigateToLead} />
        </div>
      </div>
    </div>
  );
};

export default OwnerLeadsDashboard;
